import React from "react";
import "./VideoCard.css";

function VideoCard({ image, title, channel, views, timestamp}) {
  return (
    <div className="video-card">
      <img src={image} alt="" />
      <div className="video-content">
        <div className="video-text">
          <p>{title}</p>
          <p>{channel}</p>
          <p>
            {views} â€¢ {timestamp}
          </p>
        </div>
      </div>
    </div>
  );
}

export default VideoCard;
